	switch (action.type) {
		case 'ALREADY LOGIN':			
			return {...state , isLogin : true}
		case 'ALREADY LOGOUT':
			const newState2 = { isLogin: false }
			console.log('call disppatch')
			return newState2
		default:
			return state
	}
}
